import React from 'react'
import Product from './Product';

export const ProductList = () => {
    return (
        <div className="row">
            <div>
                <h1>our products</h1>
                <div className="container">
                    <div className="col-3">
                        <Product />
                        <Product />
                        <Product />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ProductList;
